import React, {Component} from 'react'
import { Rating } from 'semantic-ui-react'
const { username, plant_care_rating } = this.props.user

class Profile extends Component {

	componentDidMount() {
		console.log(this.props.user)
	}

	render() {
		const rate = 5

		return (
			<div className="ui container divided relaxed two column grid">
				<div className="ui divided items">
					<div className="item">
						<div className="ui avatar circular image"><img src="/images/wireframe/image.png"/></div>
						<div className="content"><div className="header">{username}</div>
							<div className="meta"><span>Date</span><span>Category</span></div>
							<Rating maxRating={5} defaultRating={rate} icon='star' size='huge' />
						</div>
					</div>
				</div>
			</div>
		)
	}
}

export default Profile
